import React from 'react';
import * as instancesVal from '../instances_val2017.json';

const classes = [];

const parseCategories=()=> {
	const classesTemp = [];
	(<any>instancesVal).categories.forEach((item: any) => {

		if (!(item.supercategory in classes)) {
			classes[item.supercategory] = [];
		}
		if (!(item.name in classes[item.supercategory])) {
			classes[item.supercategory].push(item.name)
		}
	});

}


export function parseSuperCategories(): string[]{
	const supercategories = (<any>instancesVal).categories.map((item:any) => item.supercategory).filter((value:any, index:any, self:any) => self.indexOf(value) === index);
	return supercategories as string[];
}
export function parseSubCategories(): string[]{
	const supercategories = (<any>instancesVal).categories.map((item:any) => item.name).filter((value:any, index:any, self:any) => self.indexOf(value) === index);
	return supercategories as string[];
}
